import React, { useEffect } from "react";

import {
  Route,
  Switch,
  Redirect,
  useHistory,
  useLocation
} from "react-router-dom";

import Get from "./Get";
import Login from "./Login";
import Post from "./Post";
import NotFound from "../NotFound";

function PrivateRoute({ children, ...rest }) {
  return (
    <Route
      {...rest}
      render={({ location }) =>
        fakeAuth.isAuthenticated ? (
          children
        ) : (
          <Redirect
            to={{
              pathname: "/login",
              state: { from: location }
            }}
          />
        )
      }
    />
  );
}

function AdminApp(props) {
  useEffect(() => {
    props.isAdminChange();
    return () => {
      props.isAdminChange();
    }; //eslint-disable-next-line
  }, []);

  return (
    <>
      <Switch>
        <Route path="/admin" exact>
          <Login></Login>
        </Route>
        <Route path="/admin/get" exact>
          <Get></Get>
        </Route>
        <Route path="/admin/Login">
          <Login></Login>
        </Route>
        <Route path="/admin/post">
          <Post></Post>
        </Route>
        <Route>
          <NotFound></NotFound>
        </Route>
      </Switch>
    </>
  );
}

export default AdminApp;
